import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Educacion } from 'src/app/model/educacion';
import { EducacionService } from 'src/app/services/educacion.service';

@Component({
  selector: 'app-new-educacion',
  templateUrl: './new-educacion.component.html',
  styleUrls: ['./new-educacion.component.css'],
})
export class NewEducacionComponent {
  nombreE!: string;
  descripcionE!: string;

  constructor(
    private educacionService: EducacionService,
    private router: Router
  ) {}

  onCreate(): void {
    const educacion = new Educacion(this.nombreE, this.descripcionE);
    this.educacionService
      .save(educacion)
      .subscribe((data) => alert('Educacion creada'));
  }
}
<div class="container">
  <div class="row">
    <div>
      <form (ngSubmit)="onCreate()" novalidate #f="ngForm">
        <div class="form-group">
          <label for="nombreE">Nombre de la institucion</label>
          <input
            type="text"
            id="nombreE"
            class="form-control"
            name="nombreE"
            [(ngModel)]="nombreE"
            required
          />
        </div>
        <div class="form-group">
          <label for="nombreE">Descripcion de sus estudios</label>
          <input
            type="text"
            id="descripcionE"
            class="form-control"
            name="descripcionE"
            [(ngModel)]="descripcionE"
            required
          />
        </div>
        <button class="btn btn-primary">Agregar educacion</button>
      </form>
    </div>
  </div>
</div>
